import { Header, Form, TextArea} from 'semantic-ui-react';

function App() {
  return (
    <div>
      <div className="header">
        <Header as='h1'>TRYCODE</Header>
      </div>
      <div className="editor">
      <Form>
        <TextArea placeholder='Tell us more' />
      </Form>
      </div>
    </div>
  );
}

export default App;
